import React from 'react';

const SideBarButton = (props) => {



				var whiteBackground = (
							<a className={'flex gap-4 bg-white text-teal active:bg-teal active:text-teal focus:text-teal px-8 py-5 rounded-lg fill-teal active:fill-teal focus:fill-teal'}>
								{props.icon}
								<span className={'grow font-bold'}>{props.name}</span>
							</a>
					);

				var transparentBackground = (

							<a className={'flex gap-4 hover:bg-bright-teal active:bg-white active:text-teal focus:text-teal px-8 py-5 rounded-lg fill-white active:fill-teal focus:fill-teal'}>
								{props.icon}
								<span className={'grow font-bold'}>{props.name}</span>
							</a>

					);

				return props.selected ? whiteBackground : transparentBackground;

}



export default SideBarButton;
